	add("relexifier", "{\"term\":\"relexifier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who relexifies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Lefebvre, Claire, [http://www.archipel.uqam.ca/264/1/Haitian_TMA_system.pdf \u0027The tense, mood and aspect system of Haitian Creole and the problem of transmission of grammar in creole genesis\u0027], Université du Québec à Montréal, p. 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027relexifiers\u0027\u0027 thus relabelled the lexical entry copied from \u0027kò\u0027 as \u0027te\u0027, a reduced form of \u0027été\u0027. This derivation accounts straightforwardly for the fact that the properties of \u0027te\u0027 in the Haitian lexicon parallel those of \u0027kò\u0027 in the Fongbe lexicon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("relic", "{\"term\":\"relic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) {{m|fro|relique}}, from Latin {{m|la|reliquiae||remains, relics}}, from {{m|la|relinquō||I leave behind, abandon, relinquish}}, from \u0027\u0027 + {{m|la|linquō||I leave, quit, forsake, depart from}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which remains; that which is left after loss or decay; a remaining portion.\u0026lt;!-- Webster 1913 --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something old kept for sentimental reasons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A part of the body of a saint, or an ancient religious object, kept for veneration\", \"priority\":3}]}, \"synonyms\":{}}");

