	add("reliance", "{\"term\":\"reliance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027rely\u0027 + \u0027-ance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of relying on someone or something; trust\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027reliance\u0027\u0027 on promises which proved to be of very little value\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The condition of being reliant or dependent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person or thing which relies on another\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Anything on which to rely; ground of trust\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The boat was a poor \u0027\u0027reliance\", \"priority\":7}]}, \"synonyms\":{}}");

	add("relict", "{\"term\":\"relict\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027relictus\u0027 past participle of \u0027relinquō\u0027 (lang\u003dla) from \u0027\u0027 + \u0027linquō\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that, or someone who, survives or remains or is left over after the loss of others; a relic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The surviving member of a married couple after one or the other has died; a widow or widower\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1801\u0027\u0027, in the \u0027Reports of cases decided in the High court of Chancery of Maryland\u0027, volume 3, page 268\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Upon which the Chancellor, by way of note said, \u0027it is suggested, that there is a \u0027\u0027relict\u0027\u0027 of the deceased, married to another man, who has joined her in a power of attorney to authorize the sale of her interest\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Patrick O\u0027Brian, \u0027HMS Surprise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But I am not the penniless nonentity I was when we first met; I can offer an honorable if not a brilliant marriage; and at the very lowest I can provide my wife – my widow, my \u0027\u0027relict\u0027\u0027 – with a \u0027decent competence\u0027, an assured future\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A species, organism or ecosystem which has survived from a previous age: one which was once widespread but which is now found only in a few areas\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, M. Zimmerman et al., in \u0027\u0027\u0027Relict\u0027\u0027 Species: Phylogeography and Conservation Biology\u0027 (edited by Jan Christian Habel, Thorsten Assmann), page 324\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The species may be a \u0027\u0027relict\u0027\u0027 of former stages of historical vegetation and landscape development resulting from past climate changes (glacial and post- glacial periods\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A structure or other feature which has survived from a previous age\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Mark Keiter, Chris Ballhaus, Frank Tomaschek, \u0027A New Geological Map of the Island of Syros (Aegean Sea, Greece)\u0027, page 16\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Dark rims around the pillows are caused by glaucophane enrichment, possibly a \u0027\u0027relict\u0027\u0027 of a primary interaction between basalt and seawater, causing Na- enrichment in the original glass crust of the pillows\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A survival of an archaic word, language or other form\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A small number of linguists believe that Cimbrian is not an Austro-Bavarian dialect but a \u0027\u0027relict\u0027\u0027 of Lombardic\", \"priority\":14}]}, \"synonyms\":{}}");

