	add("religiophobia", "{\"term\":\"religiophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027religiō\u0027 (moral obligation, worship) and Ancient greek (to 1453) \u0027φόβος\u0027 (fear)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fear or anxiety of religion, religious faith, religious people or religious organisations\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, A Chakravarti, \u0027Humanism and Indian Thought\u0027, G.S. Press, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hence it is not necessary for the scientists to develop a sort of \u0027\u0027\u0027religiophobia\u0027\u0027\u0027 nor is it necessary for the religious man to develop an attitude of suspicion against science\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Jim Sleeper, \u0027Liberal Racism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Racial groupthink and \u0026quot;\u0027\u0027religiophobia\u0027\u0027\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Ethan Walker, \u0027The Mystic Christ\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In fact he reverses the issue of \u0027\u0027religiophobia\u0027\u0027 by stating flatly that those who are not against him are for him\", \"priority\":7}]}, \"synonyms\":{}}");

