	add("reliquary", "{\"term\":\"reliquary\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027reliquaire\u0027 (modern French \u0027reliquaire\u0027 , from \u0027reliquiarium\u0027 from \u0027reliquia\u0027 (a relic) (English \u0027relic\u0027 , noun use of \u0027reliquus\u0027 (abandoned, left behind, relict) from \u0027relinquo\u0027 (i relinquish) from \u0027re-\u0027 (again) and \u0027linquo\u0027 (i leave) from Proto-indo-european {{m|ine-pro|*leikʷ-}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A container to hold or display religious relics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The other piece—the one that concerns us—is known as the Borgia \u0027\u0027reliquary\u0027\u0027.”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An object that sustains the memory of past people or events\", \"priority\":3}]}, \"synonyms\":{}}");

	add("relish", "{\"term\":\"relish\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Alteration of \u0027reles\u0027 (scent, taste, aftertaste) from Old french (842-ca. 1400) \u0027relais\u0027 \u0027reles\u0027 (something remaining, that which is left behind) from \u0027relaisser\u0027 (to leave behind)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pleasing taste; flavor that gratifies the palate; hence, enjoyable quality; power of pleasing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027. David Hume. \u0027Enquiries concerning the human understanding and concerning the principles of moral.\u0027 London: Oxford University Press, 1973. § 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Laplander or Negro has no notion of the \u0027\u0027relish\u0027\u0027 of wine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Much pleasure we have lost while we abstained / From this delightful fruit, nor known till now / True \u0027\u0027relish\u0027\u0027, tasting\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When liberty is gone, / Life grows insipid, and has lost its \u0027\u0027relish\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Savor; quality; characteristic tinge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It preserves some \u0027\u0027relish\u0027\u0027 of old writing\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A taste for; liking; appetite; fondness\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027relish\u0027\u0027 for whatever was excellent in art\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"I have a \u0027\u0027relish\u0027\u0027 for moderate praise, because it bids fair to be judicious\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"That which is used to impart a flavor; specifically, something taken with food to render it more palatable or to stimulate the appetite; a condiment\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A cooked or pickled sauce, usually made with vegetables or fruits, generally used as a condiment\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"date\u003d21 July passage\u003dCongressmen gleefully wolfed down every imaginable version of the hot dog\u0026amp;nbsp;– smoked kielbasas, jumbo grillers, Big \u0026amp; Juicy\u0027s, kosher dogs and spiced dogs\u0026amp;nbsp;– topped with every imaginable condiment\u0026amp;nbsp;– hot mustard, sweet mustard, jalapenos, spaghetti sauce, regular \u0027\u0027relish\u0027\u0027, corn \u0027\u0027relish\u0027\u0027, maple syrup salsa and the secret sauce of Rep. (R-Ga.). (\u0026quot;If I told you the recipe,\u0026quot; an aide explained, \u0026quot;I\u0027d have to shoot you.\u0026quot\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In a wooden frame, the projection or shoulder at the side of, or around, a tenon, on a tenoned piece\", \"priority\":19}]}, \"synonyms\":{}}");

